<template>
    <div>
        <mt-header title="门户">
            <router-link to="/areas" slot="left">
                <mt-button icon="back">返回</mt-button>
            </router-link>
            <!--<mt-button icon="more" slot="right"></mt-button>-->
        </mt-header>
        <div class="g-main-content">
            <div class="buttons">
                <template v-for="value in auth">
                    <template>
                        <div class="item" @click="goto(value.id)" :key="value.id">
                            <img :src="value.img" alt="">
                            <p>{{value.name}}</p>
                        </div>
                    </template>
                </template>
            </div>
        </div>
    </div>
</template>

<script>
    export default {
        name: "index",
        methods:{
            goto(value){
                switch (value) {
                    case '258028953978745':
                        this.$router.push('/index/orderManagerment')
                        break;
                    case '681792487180153':
                        this.$router.push('/index/servicerManagerment')
                        break;
                    case '363851351820153':
                        this.$router.push('/index/customerManagerment')
                        break;
                    // case '964798123673465':
                    //     this.$router.push('/index/openSea')
                    //     break;
                    case '151769080711033':
                        this.$router.push('/index/userList')
                        break;
                    case '228207462810009':
                        this.$router.push('/index/seaServicer')
                        break;
                    case '456454564646446':
                        //this.$router.push('/index/viewPool')
                        this.$router.push('/index/queryAllServicePersonnel')
                        break;
                    case '389135497855722':
                        this.$router.push('/index/per-center')
                        break;
                    case '919537187545578':
                        this.$router.push('/index/viewPublicOrders')
                        break;
                    default:
                        break;
                }
            }
        },
        mounted() {
            this.$postwc('/sharePlatform-auth/auth/getUserCheckStatus',{}).then(res => {

                if(res.code = 'I1-00-001'){
                    let userInfor = {
                        approvalStatus:res.data.approvalStatus, //(审核状态)    0:未上传执照，待审核，1:审核通过，2:审核未通过，3：已上传执照，审核中
                        userRole:res.data.userRole,             //(账号类型)     0：公司账号，1管家账号
                        auditStatus:res.data.auditStatus,       //(实名认证状态)  0-未进行认证  1-审核中 2-审核通过 3-审核失败
                        mobile:res.data.mobile
                    };
                    sessionStorage.setItem('userInfor',JSON.stringify(userInfor));
                    sessionStorage.setItem('merType',res.data.merType);
                    sessionStorage.setItem('mobile',res.data.mobile);
                }
            });

            //this.bodyHeight=document.documentElement.clientHeight;
            let that =this;
            let auth = this.$store.state.auth || JSON.parse(localStorage.getItem('auth'));
            //console.log(auth)
            if(!auth){
                this.$router.push('/')
            }
            let tmpArr = []
            auth.forEach(function (v,i) {
                switch (v.id) {
                    case '258028953978745':
                        v.name = '订单管理系统';
                        v.img = 'data:image/png;base64,'
                        v.num = '1';
                        tmpArr.push(v);
                        break;
                    case '681792487180153':
                        v.name = '服务人员管理系统';
                        v.img = 'data:image/png;base64,'
                        v.num = '2';
                        tmpArr.push(v);
                        break;
                    case '363851351820153':
                        v.name = '客户管理系统';
                        v.img = 'data:image/png;base64,'
                        v.num = '3';
                        tmpArr.push(v);
                        break;
                    // case '964798123673465':
                    //     v.name = '捞取公海订单';
                    //     v.img = 'data:image/png;base64,'
                    //     v.num = '9';
                    //     tmpArr.push(v);
                    //     break;
                    case '151769080711033':
                        v.name = '添加管家';
                        v.img = 'data:image/png;base64,'
                        v.num = '4';
                        tmpArr.push(v);
                        break;
                    case '228207462810009':
                        v.name = '捞取公海服务人员';
                        v.img = 'data:image/png;base64,'
                        v.num = '8';
                        tmpArr.push(v);
                        break;
                    case '456454564646446':
                        v.name = '查看公海服务人员';
                        v.img = 'data:image/png;base64,'
                        v.num = '6';
                        tmpArr.push(v);
                        break;
                    case '389135497855722':
                        v.name = '我的账户';
                        v.num = '7';
                        v.img='data:image/png;base64,';
                        tmpArr.push(v);
                        break;
                    case '919537187545578':
                        v.name = '查看公海订单';
                        v.img = 'data:image/png;base64,'
                        v.num = '5';
                        tmpArr.push(v);
                        break;
                    default:
                        break;
                }
            })
            //console.log('后端顺序-模块',tmpArr);
            var objectArraySort = function (keyName) {
                return function (objectN, objectM) {
                    var valueN = objectN[keyName]
                    var valueM = objectM[keyName]
                    if (valueN < valueM) return -1
                    else if (valueN > valueM) return 1
                    else return 0
                }
            }
            tmpArr.sort(objectArraySort('num'));
            //console.log('前端强制排序-模块',tmpArr);

            this.auth = tmpArr
            pushHistory()
            that.gotoURL(function () {
                pushHistory()
                that.$router.push('/areas')
            })

        },
        data(){
            return {
                auth:[]
            }
        },
        computed:{

        }
    }
</script>

<style scoped lang="scss">
    @function px2rem($px) {
        @return $px / 16px * 1rem
    }
    .g-main-content {
        padding: px2rem(15px);
        .buttons {
            display: grid;
            grid-template-columns: 50% 50%;
            // height: 30rem;
            text-align: center;
            /*border: 1px solid #9e9e9e;*/
            .item {
                /*line-height: 10rem;*/
                border: 1px solid #ddd;
                margin-top: -1px;
                margin-left: -1px;
                height: 10rem;
                img {
                    height: 3rem;
                    object-fit: cover;
                    margin-top: 2rem;
                }

                p {
                    margin-top: 1rem;
                }
            }
        }
    }
</style>
